  \"Innovative Structural and Material Concepts for Low-Weight Low-Drag Aircraft Design
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T03:50:56.535354\",\n\t\"name\":
  \"innovative-structural-and-material-concepts-for-low-weight-low-drag-aircraft-design-projec-9b8b9\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The overall technical objective of this
  multi-phase project is to develop and validate a so-called 'AAW-Process' that consists
  of (i) the Active Aeroelastic Wing (AAW) technology of employing multiple control
  surfaces in tandem for achieving loads alleviation and drag minimization using the
  over-determined trim capability of ZONA Euler Unsteady Solver (ZEUS), and (ii) the
  aeroelastic tailoring technique for optimum stiffness distribution and weight minimization
  while satisfying structural design constraints using ZONA's Automated STRuctural
  Optimization System (ASTROS). The technical objectives specific to Phase II effort
  are twofold: (1) Analytically design the four Subsonic Ultra Green Aircraft Research
  (SUGAR) wind-tunnel models that employ Distributed Multiple Control Surfaces (DMCS)
  and Variable Camber Continuous Trailing Edge Flap (VCCTEF) to achieve the weight
  and drag benefits, and (2) Fabrication of one of these four designed models to validate
  the AAW-process experimentally by a future wind tunnel testing. As per the first
  specific objective, four wind tunnel models will be designed for high speed Transonic
  Dynamic Tunnel (TDT) testing along with their detailed fabrication and wind tunnel
  testing plans. These four models are carefully chosen to incrementally demonstrate
  the benefits of applying AAW technology and aeroelastic tailoring technique by potential
  future fabrication and wind tunnel tests. As per the second specific objective,
  the fabricated wind tunnel model will be delivered to NASA along with its target
  performance improvement predicted by AAW-process for validation with a near-term
  wind tunnel testing. In order to ensure the safety of the wind tunnel models during
  the TDT testing, flutter suppression and gust load alleviation controllers will
  be designed for those models that are not aeroelastically tailored and have analytically
  displayed potential flutter instability problems.\",\n\t\"license_title\": \"U.S.
